<!-- FAQ — Dark                             -->
<!-- ═══════════════════════════════════════ -->
<section class="s-charcoal" id="faq">
  <div class="section-inner" style="text-align: center;">
    <div class="eyebrow">FAQ</div>
    <h2 class="heading-xl">Questions fréquentes.</h2>
  </div>
  <div class="faq-grid">
    <div class="faq-item" onclick="this.classList.toggle('open')">
      <div class="faq-q">À partir de quel âge peut-on s'inscrire?</div>
      <div class="faq-a">Les inscriptions sont ouvertes aux jeunes à partir de 9 ans. Les groupes sont ensuite formés selon l'âge et le niveau pour assurer un encadrement adapté.</div>
    </div>
    <div class="faq-item" onclick="this.classList.toggle('open')">
      <div class="faq-q">Est-ce que le camp convient aux débutants?</div>
      <div class="faq-a">Oui! Pour les groupes primaires, le camp est parfaitement adapté aux débutants. Pour les secondaires, le niveau est plus élevé, ce qui peut représenter un défi pour un jeune n'ayant jamais joué.</div>
    </div>
    <div class="faq-item" onclick="this.classList.toggle('open')">
      <div class="faq-q">Que doit apporter mon enfant chaque jour?</div>
      <div class="faq-a">Votre enfant doit simplement apporter des vêtements de sport, des souliers de basket et un repas pour le dîner. Tout le reste est fourni — t-shirt officiel, matériel d'entraînement, ballons.</div>
    </div>
    <div class="faq-item" onclick="this.classList.toggle('open')">
      <div class="faq-q">Offrez-vous des rabais pour les fratries?</div>
      <div class="faq-a">Oui, nous offrons des rabais pour les fratries ainsi que pour les jeunes inscrits à plusieurs semaines de camp, afin de rendre l'expérience plus accessible aux familles.</div>
    </div>
    <div class="faq-item" onclick="this.classList.toggle('open')">
      <div class="faq-q">Comment fonctionne l'inscription?</div>
      <div class="faq-a">Sélectionnez la semaine désirée, entrez les informations de votre jeune, puis complétez le paiement sur notre plateforme sécurisée. Une confirmation électronique vous sera envoyée automatiquement.</div>
    </div>
    <div class="faq-item" onclick="this.classList.toggle('open')">
      <div class="faq-q">Comment gérez-vous les blessures?</div>
      <div class="faq-a">En cas de blessure ou de malaise, votre enfant est immédiatement pris en charge par un membre de l'équipe. Au besoin, nous communiquons rapidement avec les parents.</div>
    </div>
    <div class="faq-item" onclick="this.classList.toggle('open')">
      <div class="faq-q">Les activités se déroulent-elles en cas de pluie?</div>
      <div class="faq-a">Oui! Les gymnases sont équipés de ventilation et permettent de poursuivre les activités à l'intérieur en tout temps. La sécurité des jeunes reste notre priorité.</div>
    </div>
  </div>
</section>

